import React from 'react';
import { Link } from 'react-router-dom';

const Project = (props) => {  

  return (
    <div>
      <div>
        <img src={props.image} alt={props.name}/>
      </div>
      <h2>{props.name}</h2>
      <p>{props.description}</p>
      <Link></Link>
    </div>
  );
}

export default Project;
